package datatypes;

public class SwappingValues {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int a=10;
		int b=20;
		int c;
		c=10;
		a=b;
		b=c;
		
		System.out.println("a After Swap "+a);
		
		System.out.println("b After swap "+b);
	
		
	
		

	}

}
